INSERT INTO `cells` (`id`, `rowId`, `colCount`, `type`, `ContentA`, `ContentB`, `ContentC`, `ContentD`, `image`, `created_at`, `updated_at`) VALUES
(1, 2, 1, 'Text', 'CoreData enlists only bona fide consumers to participate in its ‘shadow shopping’ activities. These‘shoppers’ are not trained by CoreData in any aspect of the ‘shop’ other than what to expect from the financial planning process and how to complete the post-meeting shopper survey. CoreData shoppers are not trained in compliance or any aspects of an expected level of client experience.\n\n When reading this individual report, it is very important to remember that the information provided within is based on the shopper’s ability to recall the ‘conversations & content’ from the individual shops.\n\n In particular, with reference to the provision of compliance documents, the ‘shopper’ may have received such documents in the ‘shopper interview’ but at later point in time (whilst completing the online shop survey) not recall receiving such documents.\n\n This report sets out the ‘shopper\'s’ opinions and perceptions and not necessarily facts. They reflect the overall impressions left in the mind of the ‘shopper’ that will guide their decision to deal with you or recommend your service to others.\n\n One person’s opinion (good or bad) needs to be considered in the context of the rest of your business performance, and is an opportunity to ‘reality check’ your customer acquisition process and identify any areas for improvement.', 'n.a.', NULL, NULL, 'n.a.', '2018-10-18 22:28:01', '2018-10-18 22:28:01'),
(2, 3, 1, 'Numbering', 'Review your ‘Intention’ scores, as these scores will tell you what overall impression you left with the client\nConsider your high and low scores in the other sections, to build picture of where you can improve. Compare your performance to Yellow Brick Road average so you are aware of where you stand relative to your peers.', 'n.a.', NULL, NULL, 'n.a.', '2018-10-18 22:28:02', '2018-10-18 22:28:02'),
(3, 4, 1, 'Text', 'Questions and feedback about the contents of this report or the process used to conduct this shadow shopping report can be directed to Yellow Brick Road.\n\n The results of the shadow shopping process are captured in a single ACQUIRE Index. The ACQUIRE Index is comprised of the following seven key categories:', 'n.a.', NULL, NULL, 'n.a.', '2018-10-18 22:28:02', '2018-10-18 22:28:02'),
(4, 5, 1, 'Definition', 'Assurances\nCompliance\nQuality\nUnderstanding\nIntention\nReaction\nEnvironment', 'Ability to demonstrate and communicate knowledge/skills\nAbility to satisfy relevant financial regulations\nAbility to satisfy client needs and provide perceived value\nAbility to understand client needs\nClient’s intention to use and recommend service/product\nClient’s emotive response to purchase process\nTangible aspects of the purchase process', NULL, NULL, 'n.a.', '2018-10-18 22:28:02', '2018-10-18 22:28:02'),
(5, 8, 1, 'Graph', 'Your Score\nYellow\nIndustry', '84\n78\n78', 'ACQUIRE', NULL, 'data:image/png;base64,', '2018-10-18 22:28:03', '2018-10-18 22:28:05'),
(6, 9, 1, 'Text', 'Your ACQUIRE component scores versus your peer group:', 'n.a.', NULL, NULL, 'n.a.', '2018-10-18 22:28:04', '2018-10-18 22:28:04'),
(7, 10, 1, 'Text', 'n.a.', 'n.a.', NULL, NULL, 'n.a.', '2018-10-18 22:28:04', '2018-10-18 22:28:04');

